          height={height}
          zIndexImg={zIndexImg}
          zIndexImgShadow={zIndexImgShadow}
        >
          <div className="bgImg_shadow"></div>
          <div className="bgImg"></div>
          <div className="bgImg_blur"></div>
        </BackgroundImgStyle> */}

        <Parallax
          // blur={0}
          bgImage={require("../3_images/2_theInitiative/bg_initiative-banner.jpg")}
          bgImageAlt="the cat"
          strength={200}
          blur={{ min: -8, max: 15 }}
          bgClassName={"parallax_bg"}
        >
          fixed
          <div style={{ height: "100vh" }} />
        </Parallax>
      </div>
    );
  }
}
